import React from 'react'
import img1 from '../src/images/img3.svg'
import im2 from '../src/images/img4.svg'
import img3 from '../src/images/img5.svg'

const Sdata = [
    {
        img : img1,
        title : "Card Details",
        text : "Some quick example text to build on the card title and make up the bulk of the card's content.",
        buttonText : "Read More",
    },
    {
        img : img2,
        title : "Card Details",
        text : "Some quick example text to build on the card title and make up the bulk of the card's content.",
        buttonText : "Read More"
    },
     {
        img : img3,
        title : "Card Details",
        text : "Some quick example text to build on the card title and make up the bulk of the card's content.",
        buttonText : "Read More"
    },
    {
        img : img1,
        title : "Card Details",
        text : "Some quick example text to build on the card title and make up the bulk of the card's content.",
        buttonText : "Read More"
    },
    {
        img : img2,
        title : "Card Details",
        text : "Some quick example text to build on the card title and make up the bulk of the card's content.",
        buttonText : "Read More"
    },
]
export default Sdata;
